                            opcion.setAttribute(&quot;nroCuenta&quot;, res.nroCuenta);
                            idBanco.add(opcion);
                        }
                        nroCuenta.value = &#039;&#039;;

                    })
                    .catch(error =&gt; console.log(&#039;error&#039;, error));

